import React from 'react';
import classesHeader from './AppHeader.module.css'
import { BurgerIcon, Logo, ListIcon} from '@ya.praktikum/react-developer-burger-ui-components'

class AppHeader extends React.Component {
    render() {

        return (
            <header className={`p-2 text text_type_main-default ${classesHeader.header}`}>
            <div className={classesHeader.navigation}>

                <a href='/' className={classesHeader.link}> 
                <BurgerIcon type="primary" />
							<span className={classesHeader.text}>Конструктор</span>
                </a>
                <a href='/' className={classesHeader.link}>
                <ListIcon type="secondary" />
                <span type={"secondary"} className={classesHeader.text}>Лента заказов</span>
            </a>
            </div>
            <a href='/' className={classesHeader.logo}>
               <Logo/>
            </a>



            </header>

        )
    }
}



export default AppHeader;
